import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Dashboard.css';

const Dashboard = () => {
  const [user, setUser] = useState({});
  const [recentForms, setRecentForms] = useState([]);
  const [responseSummary, setResponseSummary] = useState([]);
  const [error, setError] = useState(''); // Error state to handle fetch errors

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch user data
        const userResponse = await axios.get('/api/user/profile');
        setUser(userResponse.data);

        // Fetch recent forms
        const formsResponse = await axios.get('/api/forms/recent');
        setRecentForms(formsResponse.data);

        // Fetch response summary
        const responsesResponse = await axios.get('/api/forms/responses');
        setResponseSummary(responsesResponse.data);

      } catch (err) {
        console.error('Error fetching data:', err);
        setError('Failed to fetch dashboard data. Please try again later.');
      }
    };

    fetchData();
  }, []);

  if (error) {
    return <div className="dashboard-error">{error}</div>;
  }

  return (
    <div className="dashboard-container">
      {/* User Overview */}
      <div className="user-overview">
        <h2>Welcome, {user.name ? user.name : 'User'}</h2>
        <p>Email: {user.email ? user.email : 'N/A'}</p>
        <p>Account Created: {user.createdAt ? new Date(user.createdAt).toLocaleDateString() : 'N/A'}</p>
      </div>

      {/* Recent Forms */}
      <div className="recent-forms">
        <h3>Recent Forms</h3>
        <ul>
          {recentForms.length > 0 ? (
            recentForms.map(form => (
              <li key={form._id}>
                <h4>{form.title}</h4>
                <p>{form.description || 'No description provided.'}</p>
              </li>
            ))
          ) : (
            <p>No recent forms available.</p>
          )}
        </ul>
      </div>

      {/* Response Summary */}
      <div className="response-summary">
        <h3>Response Summary</h3>
        <ul>
          {responseSummary.length > 0 ? (
            responseSummary.map(summary => (
              <li key={summary.formId}>
                <h4>{summary.formTitle}</h4>
                <p>Total Responses: {summary.responseCount}</p>
              </li>
            ))
          ) : (
            <p>No response data available.</p>
          )}
        </ul>
      </div>

      {/* Settings */}
      <div className="settings">
        <h3>Settings</h3>
        <button className="settings-btn">Account Settings</button>
        <button className="settings-btn">Privacy Settings</button>
      </div>
    </div>
  );
};

export default Dashboard;
